            Inputdata = new OuterSensor({id:"Outer",temp:status.tempOuter,humid:status.humidOuter,pm25:status.pm25Outer,pm10:status.pm10Outer,voc:status.vocOuter});



    Inputdata.save(function(error, data){
        if(error){
            console.log(error);
        }else{
            console.log(data);
            console.log('Saved!')
        }
    });
    mode = -1;
    res.render('main');
    }

});

module.exports = router;

